import React from 'react';
import Hero from '../components/Hero';
import Content from '../components/Content'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { Helmet } from 'react-helmet';
import './HomePage.css'
function HomePage(props) {

    return(
        <>
            <Hero title='Shreeya Chand' subTitle={props.subTitle} text={props.text} />
            <Content>
                <Row>
                    <Col>
                    <p>Hi! My name is Shreeya and I'm a high schooler in Maryland. 
                        I want to pursue data science or computer science, and I'm passionate about 
                        creating political s
In the future, I plan to pursue an interdisciplinary subject combining my passions in these fields and work to help others through technology and programming. A long-term goal of mine is to create a political solution or product through the means of AI and computers. 

                    </p>
                    </Col>
                </Row>
            </Content>
            <Helmet>
                <title>Shreeya Chand</title>
            </Helmet>
        </>
    );

}

export default HomePage;
